import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';  // Importando Link e Routes
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import CreateAccount from '.pages/createAccount';

function App() {
  return (
    <div>
      <nav className="p-3 bg-light">
        {/* Link que redireciona para a página de "Criar Conta" */}
        <Link to="/createAccount" className="btn btn-primary">Criar Conta</Link>
      </nav>

      <Routes>
        {/* A rota "/createAccount" vai renderizar a página de criação de conta */}
        <Route path="/createAccount" element={<CreateAccount />} />
      </Routes>
    </div>
  );
}

export default App;
